  "applicationExpirationNoaaEmail": {
    "heading": "An Update from {{bank_name}}",
    "subject": "An update from ${extBankName}",
    "body": "<tr>\n                                <td>{{applicantFirstName}},\n                                </td>\n                            </tr>\n                            <!-- Separator -->\n                            <tr><td height=\"24\"></td></tr>\n\n                            <tr>\n                                <td>Thank you for your recent application for a credit card at {{ bank_name }}. Although we have carefully reviewed your application, we regret that we cannot approve your credit request at this time because your application is incomplete.\n\n                                    <br> <br>\n\n\n\n\n\n                                    We also obtained your credit score from this consumer reporting agency and used it in making our credit decision. Your credit score is a number that reflects the information in your credit report. Your credit score can change, depending on how the information in your credit report changes. <br><br>\n\n                                    Your Credit Score: {{creditScore}}<br>\n                                    Date: {{report_pull_date}}<br>\n                                    Scores range from a low of 300 to a high of 850<br>\n                                    Key factors that adversely affected your credit score: {{factor_info}}<br><br>\n\n                                    You have the right under the Fair Credit Reporting Act to know the information contained in your credit file at the consumer-reporting agency. The reporting agency played no part in our decision and is unable to supply specific reasons why we have declined credit to you. You have a right to inspect and to receive a free copy of your report from the reporting agency, if you request it no later than 60 days after you receive this notice. In addition, if you find that any information contained in the report you receive is inaccurate or incomplete, you have the right to dispute the matter with the reporting agency. <br><br>\n\n                                    TransUnion Consumer Solutions <br>\n                                    P.O. Box 2000<br>\n                                    Chester, PA 19016-2000\n\n\n\n\n                                </td>\n\n\n                            </tr>\n\n\n                            <!-- Separator -->\n                            <tr><td height=\"12\"></td></tr>\n\n                            <tr>\n                                <td>\n                                    <strong/>\n                                </td>\n                            </tr>",
    "enabled": true
  },
