        "heading": "Telephone Consumer Protection Act for Calls and SMS",
        "body": "<p>By entering your phone number above, you are providing your express written consent and authorization by electronic signature for Catalyst Bank to contact you at that number regarding products or services, including via auto-dialed and/or prerecorded or artificial voice calls and text messages. Your consent is not a condition of purchasing any goods or services from Catalyst Bank Message and data rates may apply.</p>",
