        "text": "",
        "heading": "Electronic Communications Agreement",
        "body": "<div><p style=\"margin-bottom: 1.4rem;\"><strong>Consent for Electronic Signatures, Records, and Disclosures (\"E-Consent\")</strong></p><p style=\"margin-bottom: 1.4rem;\">Please read this information carefully and print a copy and/or retain this information electronically for future reference.</p><p><strong>Introduction.</strong></p><p style=\"margin-bottom: 1.4rem;\">Catalyst Bank. If you choose to apply for a loan through the Catalyst Bank platform, from time to time you will receive disclosures, notices, documents, and information from PARTNER, its affiliates, or from Catalyst Bank's authorized agents (collectively, “we” or “us”). To receive credit through https://www.CatalystBank.com, we need your consent to using and accepting electronic signatures, records, and disclosures (\"E-Consent\"). This form notifies you of your rights when receiving disclosures, notices and information via https://www.CatalystBank.com. By clicking \"I Consent\", you acknowledge that you received this E-Consent and that you consent to using electronic signatures, records, and disclosures. Additionally, by clicking \"I Consent\", you consent to conduct transactions by using electronic disclosures, electronic records, and electronic contract documents (\"Disclosures\").</p><p><strong>Scope of Consent.</strong></p><p style=\"margin-bottom: 1.4rem;\">This E-Consent applies to all interactions online concerning you and the Catalyst Bank Platform. By exercising this E-Consent, We will process your information and interact with you electronically. We will also send you Disclosures electronically related to interactions and transactions between Us and you. Disclosures may be provided online through the Catalyst Bank Platform or through your designated e-mail address.</p><p><strong>Consenting to Do Business Electronically.</strong><p style=\"margin-bottom: 1.4rem;\">Before you decide to agree to the E-Consent, you should consider whether you have the required hardware and software capabilities described below.</p><p><strong>Hardware and Software Requirements.</strong></p><p style=\"margin-bottom: 1.4rem;\">To access and retain the Disclosures electronically, you will need to use the following computer software and hardware: A PC or MAC compatible computer or other device capable of accessing the Internet, access to an e-mail account, and an Internet Browser software program that supports at least 128-bit encryption, such as Microsoft® Internet Explorer, Netscape® or Mozilla Firefox®. To read some Disclosures, you may need a PDF file reader like Adobe® Acrobat Reader Xpdf® or Foxit®. If these requirements change while you are maintaining an active relationship with Us and the change creates a material risk that you may not be able to receive Disclosures electronically, We will notify you of these changes. You will need a printer or a long-term storage device, such as your computer's disk drive, to retain a copy of the Disclosures for future reference. You may send Us your written questions regarding the hardware and software requirements by mail to Catalyst Bank 222 N. LaSalle St., Suite 1700, Chicago IL 60601.</p><p><strong>Option for Paper or Non-Electronic Records.</strong></p><p style=\"margin-bottom: 1.4rem;\">You have the right to receive any notice, contract documents, or disclosure in paper form, as well as a copy of this Electronic Communications Agreement. To obtain a copy of notices, contract documents, or disclosures, please call the following phone number during business hours 855-854-9395. You may also request any Disclosures in paper copy by logging into your online account and printing a paper copy, or mail Us your written request to Catalyst Bank 222 N. LaSalle St., Suite 1700, Chicago IL 60601. We will provide paper copies at no charge. We will retain all Disclosures as required under applicable law.</p><p><strong>Withdrawing Consent.</strong></p><p style=\"margin-bottom: 1.4rem;\">You can withdraw this E-Consent at any time and at no charge. However, your consent to E-Consent is required to receive services from Us over the Internet. If at any time you wish to withdraw this E-Consent, you can send Us your written request by mail to Catalyst Bank 222 N. LaSalle St., Suite 1700, Chicago IL 60601, with the details of such request. If you decide to withdraw this E-Consent, the legal effectiveness, validity, and enforceability of prior electronic Disclosures will not be affected.</p><p><strong>Change to Your Contact Information.</strong></p><p style=\"margin-bottom: 1.4rem;\">You are responsible for updating and notifying Us of any change in your electronic address or mailing address. You may update such information by logging into the loan account and providing the updated information. You may also notify Us of your updated electronic address or mailing address by mail to Catalyst Bank 222 N. LaSalle St., Suite 1700, Chicago IL 60601. You understand and agree that if Catalyst Bank provides any electronic Disclosure but you do not receive it because your electronic address or mailing address is incorrect, out of date or blocked by your Internet service provider, Catalyst Bank will still be deemed to have provided the electronic Disclosures to you.</p><p><strong>YOUR ABILITY TO ACCESS DISCLOSURES.</strong></p><p style=\"margin-bottom: 1.4rem;\">BY CLICKING \"I CONSENT\" OR OTHER LINKS, YOU ASSENT TO THE TERMS IN THIS ELECTRONIC COMMUNICATIONS AGREEMENT, INCLUDING USING ELECTRONIC SIGNATURES AND HAVING ALL DISCLOSURES PROVIDED OR MADE AVAILABLE TO YOU IN ELECTRONIC FORM AND TO DOING BUSINESS WITH US ELECTRONICALLY. YOU ACKNOWLEDGE THAT YOU HAVE READ THIS INFORMATION ABOUT ELECTRONIC SIGNATURES, RECORDS, DISCLOSURES, CONTRACT DOCUMENTS AND DOING BUSINESS ELECTRONICALLY. YOU ACKNOWLEDGE THAT YOU CAN ACCESS THE ELECTRONIC DISCLOSURES IN THE DESIGNATED FORMATS DESCRIBED ABOVE. Once you give your consent, you can log into the loan account to access these documents. If you use a spam filter or other technology that blocks or re-routes emails from senders not listed in your email address book, you must add apply@loan.catalyst.com to your email address book so that you receive the electronic Disclosures provided by Us.</p>",
